import React, { Component } from "react";
import { connect } from "react-redux";
import {
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBCardTitle,
  MDBCardText,
  MDBInputGroup,
  MDBRow,
  MDBCol,
  MDBBtn,
  MDBRating,
  MDBIcon,
  MDBInput,
  MDBContainer,
} from "mdbreact";

export class saloncontainer extends Component {
  render() {
    return (
      <div>
        <MDBRow>
          <MDBCol md="12" className="mb-0">
            <img
              src="https://www.for-interieur.fr/wp-content/uploads/2017/05/amenagement-salon-de-coiffure-1.jpg"
              className="img-fluid z-depth-1"
              alt=""
            />
          </MDBCol>
        </MDBRow>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(saloncontainer);

